sources.index.css:
@import url(https://fonts.googleapis.com/css?family=Inter:300,regular,700&display=swap);
@import url(https://fonts.googleapis.com/css?family=Inika:regular,700&display=swap);
@import url(https://fonts.googleapis.com/css?family=Roboto:regular&display=swap);
@import "./src/base/style.css";
* {
  padding: 0;
  margin: 0;
  border: 0;
}

*,
*:before,
*:after {
  box-sizing: border-box;
}

:focus,
:active {
  outline: none;
}

a:focus,
a:active {
  outline: none;
}

nav,
footer,
header,
aside {
  display: block;
}

html,
body {
  height: 100%;
  width: 100%;
  font-size: 100%;
  line-height: 1;
  font-weight: 400;
  font-size: 10px;
  -ms-text-size-adjust: 100%;
  -moz-text-size-adjust: 100%;
  -webkit-text-size-adjust: 100%;
  font-family: "Inter", sans-serif;
  color: #000000;
}

input,
button,
textarea {
  font-family: inherit;
}

input::-ms-clear {
  display: none;
}

button {
  cursor: pointer;
}

button::-moz-focus-inner {
  padding: 0;
  border: 0;
}

a,
a:visited {
  text-decoration: none;
}

a:hover {
  text-decoration: none;
}

ul li {
  list-style: none;
}

img {
  vertical-align: top;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  font-size: inherit;
  font-weight: inherit;
}

[class*=__container] {
  max-width: 1250px;
  margin: 0 auto;
  padding: 0 15px;
  min-height: 100%;
}

body.lock {
  overflow: hidden;
}

.wrapper {
  min-height: 100%;
  display: flex;
  flex-direction: column;
  overflow: hidden;
}
.wrapper > main {
  flex: 1 1 auto;
}
.wrapper > * {
  min-width: 0;
}

.ibg {
  position: relative;
}
.ibg img {
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  -o-object-fit: cover;
     object-fit: cover;
}

.contacts__info {
  display: flex;
  flex-direction: column;
  padding-top: 90px;
  width: 450px;
}
.contacts__select {
  width: 100%;
  position: relative;
}
.contacts__select.open .select__input {
  padding: 10px 35px 10px 35px;
  background-color: #C1E698;
}
.contacts__select.open .select__input span {
  background-color: #8BA07E;
  transform: rotate(-180deg);
}
.contacts__select.open .select__dropdown {
  display: block;
}

.select__input {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 35px 10px 20px;
  font-size: 2rem;
  color: #717171;
  letter-spacing: 1px;
  background-color: #D6E7D2;
  box-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
  height: 50px;
  cursor: pointer;
}
.select__input span {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 16px;
  height: 16px;
  background-color: #AEA1A1;
  border-radius: 100%;
}
.select__input span::before {
  font-size: 0.7rem;
  color: #ffffff;
}
.select__dropdown {
  padding: 25px 35px;
  display: none;
  position: absolute;
  width: 100%;
  top: 50px;
  left: 0;
  right: 0;
  background-color: #DCE9D9;
  font-size: 1.6rem;
  max-height: 200px;
  overflow-y: auto;
  color: #717171;
}
.select__item {
  font-size: 1.6rem;
  letter-spacing: 1px;
  color: #499A18;
  padding: 10px 0;
  transition: color 0.3s ease 0s;
  cursor: pointer;
}
.select__item:hover {
  color: #717171;
}

.header {
  background-color: #edf2ec;
}
.header__content {
  min-height: 134px;
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 10px;
}
@media (max-width: 768.98px) {
  .header__content {
    min-height: 117px;
  }
}
@media (max-width: 380.98px) {
  .header__content {
    min-height: 96px;
  }
}
.header__logo {
  display: flex;
  align-items: center;
  z-index: 10;
  color: inherit;
}
@media (max-width: 380.98px) {
  .header__nav {
    flex-direction: column;
    position: fixed;
    left: -100%;
    top: 0;
    width: 100%;
    height: 50%;
    overflow: auto;
    z-index: 2;
    background-color: #edf2ec;
    padding: 120px 15px 30px 15px;
    transition: left 0.4s ease 0s;
  }
}
@media (max-width: 380.98px) and (max-width: 520px) {
  .header__nav {
    height: 70%;
  }
}
@media (max-width: 380.98px) {
  .header__nav::before {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 78px;
    z-index: 2;
  }
}
@media (max-width: 380.98px) {
  .header__nav.menu-open {
    left: 0;
  }
}
.header__list {
  display: flex;
  -moz-column-gap: 45px;
       column-gap: 45px;
  flex-wrap: wrap;
  row-gap: 5px;
}
@media (max-width: 380.98px) {
  .header__list {
    flex-direction: column;
    text-align: center;
  }
}
.header__link {
  color: inherit;
  font-family: Inika;
  font-size: 1.6rem;
  line-height: 1.5;
  transition: color 0.3s ease 0s;
}
@media (max-width: 380.98px) {
  .header__link {
    font-size: 2rem;
  }
}
.header__link:hover {
  color: #e06733;
}

.logo__text {
  font-family: Inika;
  font-size: 1.6rem;
}

.icon-menu {
  background-color: inherit;
  display: none;
}
@media (max-width: 380.98px) {
  .icon-menu {
    display: block;
    position: relative;
    height: 22px;
    flex: 0 0 30px;
    z-index: 5;
  }
  .icon-menu span, .icon-menu::before, .icon-menu::after {
    content: "";
    transition: all 0.3s ease 0s;
    left: 0;
    position: absolute;
    width: 100%;
    height: 2px;
    background-color: #173a56;
  }
  .icon-menu::before {
    top: 0;
  }
  .icon-menu::after {
    bottom: 0;
  }
  .icon-menu span {
    transform: scale(1) translate(0, -50%);
  }
  .icon-menu.menu-open span {
    transform: scale(0) translate(0, -50%);
  }
  .icon-menu.menu-open::before {
    top: 50%;
    transform: rotate(-45deg);
  }
  .icon-menu.menu-open::after {
    bottom: calc(50% - 1px);
    transform: rotate(45deg);
  }
}

.welcome {
  background-color: #edf2ec;
}
.welcome__container {
  padding-top: 62px;
  padding-bottom: 62px;
}
@media (max-width: 768.98px) {
  .welcome__container {
    padding-top: 40px;
    padding-bottom: 40px;
  }
}
@media (max-width: 380.98px) {
  .welcome__container {
    padding-top: 30px;
    padding-bottom: 30px;
  }
}
.welcome__body {
  display: flex;
  justify-content: space-between;
  align-items: center;
}
@media (max-width: 768.98px) {
  .welcome__body {
    flex-direction: row-reverse;
  }
}
.welcome__image {
  flex: 1 1 37%;
}
@media (max-width: 450px) {
