    max-width: 1250px;
    margin: 0 auto;
    padding: 0 15px;
    min-height: 100%;
}

body {
    &.lock {
        overflow: hidden;
    }
}

.wrapper {
    min-height: 100%;
    display: flex;
    flex-direction: column;
    overflow: hidden;

    // Прижимаем footer
    >main {
        flex: 1 1 auto;
    }

    // Фикс для слайдеров
    >* {
        min-width: 0;
    }
}

// ======================================================================================================================
.ibg {
    position: relative;

    img {
