    @media (max-width: $small) {
      flex-direction: column;
      position: fixed;
      left: -100%;
      top: 0;
      width: 100%;
      height: 50%;
      overflow: auto;
      z-index: 2;
      background-color: $section-bg;
      padding: 120px 15px 30px 15px;
