      @media (max-width: 520px) {
        height: 70%;
      }

      &::before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 78px;
        // background-color: $white-bg;
        z-index: 2;
      }

      &.menu-open {
