//Burger
.icon-menu {
  background-color: inherit;
  display: none;

  @media (max-width: $small) {
    display: block;
    position: relative;
    // width: 30px;
    height: 22px;
    flex: 0 0 30px;
    z-index: 5;

    span,
    &::before,
    &::after {
      content: "";
      transition: all 0.3s ease 0s;
      left: 0;
      position: absolute;
      width: 100%;
      height: 2px;
      background-color: #173a56;
    }

    &::before {
      top: 0;
    }

    &::after {
      bottom: 0;
    }

    span {
      // top: 50%;
      transform: scale(1) translate(0, -50%);
    }

    &.menu-open {
      span {
        transform: scale(0) translate(0, -50%);
      }

      // &::before,
      // &::after {
      // }
      &::before {
        top: 50%;
        transform: rotate(-45deg);
      }

      &::after {
        bottom: calc(50% - 1px);
        transform: rotate(45deg);
      }
    }
  }
}

