    &__title {
        display: flex;
        align-items: center;
        justify-content: space-between;
        width: 100%;
        height: 50px;
        padding: 16px 40px 16px;
        border-radius: 20px;
        font-weight: 700;
        font-size: 2rem;
        background-color: #EDF2EC;
        transition: all 0.3s ease 0s;

        span {
            display: flex;
            justify-content: center;
            align-items: center;
            width: 16px;
            height: 16px;
            border-radius: 100%;
            background-color: #D9D9D9;
